import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../../../Css/TwoColumnPage.css';
import ChapterContent from './ChapterContent';

const TwoColumnPage = ({ selectedSubject }) => {
  const [topicsData, setTopicsData] = useState({});
  const [selectedTopic, setSelectedTopic] = useState('');
  const [selectedSubtopic, setSelectedSubtopic] = useState('');
  const [content, setContent] = useState('');
  const [data, setData] = useState([]);

  // Fetch topics data from the database
  useEffect(() => {
    const fetchTopicsData = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/topics/${selectedSubject}`);
        const fetchedLinks = response.data.links; // Assume 'links' contains the JSON provided
        console.log(fetchedLinks);
        const groupedData = groupLinksByTopicAndLevel(fetchedLinks);
        setData(fetchedLinks);
        setTopicsData(groupedData);
      } catch (error) {
        console.error('Error fetching topics data:', error);
      }
    };

    if (selectedSubject) {
      fetchTopicsData(); // Fetch data whenever selectedSubject changes
    }
  }, [selectedSubject]);

  // Group fetched links by topic and level
  const groupLinksByTopicAndLevel = (links) => {
    const groupedData = {};
    links.forEach((link) => {
      const { topicId, level, title, description, link: url, rating } = link;
      if (!groupedData[topicId]) {
        groupedData[topicId] = {};
      }
      if (!groupedData[topicId][title]) {
        groupedData[topicId][title] = [];
      }

      groupedData[topicId][title].push({ title, description, url, rating });
      console.log(groupedData);
    });
    return groupedData;
  };

  // Handle topic selection
  const handleTopicSelect = (topic) => {
    setSelectedTopic(topic);
    console.log(topic);
    setSelectedSubtopic('');
    setContent('');
  };

  // Handle subtopic selection
  const handleSubtopicSelect = (subtopic) => {
    setSelectedSubtopic(subtopic);
   
    setContent(topicsData[selectedTopic][subtopic]);
  };

  return (
    <div className="two-column-page">
      {/* Left column: Topics and Subtopics */}
      <div className="left-column">
        <h3>Chapter</h3>
        {Object.keys(topicsData).length > 0 ? (
          <ul>
            {Object.keys(topicsData).map((topic) => (
              <li key={topic}>
                <button
                  onClick={() => handleTopicSelect(topic)}
                  className={topic === selectedTopic ? 'active' : ''}
                  {...console.log(topic)}
                >
                    
                  Topic {topic}
                </button>
                {topic === selectedTopic && topicsData[topic] && (
                  <ul className="subtopics-list">
                    {Object.keys(topicsData[topic]).map((subtopic) => (
                      <li key={subtopic}>
                        <button
                          onClick={() => handleSubtopicSelect(subtopic)}
                          className={subtopic === selectedSubtopic ? 'active' : ''}
                        >
                          {subtopic}
                        </button>
                      </li>
                    ))}
                  </ul>
                )}
              </li>
            ))}
          </ul>
        ) : (
          <p>No topics available for the selected subject.</p>
        )}
      </div>

      {/* Right column: Content */}
      <div className="right-column">
        {selectedSubtopic ? (
          <>
            <h2>{selectedSubtopic}</h2>
            {content && (
              <ul>
                {content.map((item, index) => (
                  <li key={index}>
                    <h3>{item.title}</h3>
                    <p>{item.description}</p>
                    <a href={item.url} target="_blank" rel="noopener noreferrer">
                      {item.url}
                    </a>
                    <p>Rating: {item.rating}/5</p>
                  </li>
                ))}
              </ul>
            )}
          </>
        ) : selectedTopic ? (
          <p>Select a subtopic to view its content.</p>
        ) : (
          <p>Select a topic to view its subtopics.</p>
        )}
      </div>
    </div>
  );
};

export default TwoColumnPage;
